import './Filme.css';

const filmes = [{
    'nome': 'Vingadores',
    'duracao': '2H30',
    'foto': 'Vingadores.jpg',
    'ano': 2012,
    'genero': 'ação/Nerd',
    'descricao': 'Filme da Marvel de super-heróis',
    'nota': 8
},
{
    'nome': 'Vingadores 2',
    'duracao': '2H00',
    'foto': 'Vingadores.jpg',
    'ano': 2014,
    'genero': 'ação/Nerd',
    'descricao': 'Filme da Marvel de super-heróis',
    'nota': 8.5
},
{
    'nome': 'Vingadores 3',
    'duracao': '2H40',
    'foto': 'Vingadores.jpg',
    'ano': 2018,
    'genero': 'ação/Nerd',
    'descricao': 'Filme da Marvel de super-heróis',
    'nota': 8
}
]

export default function Filme() {
    return (
        <div className='conteiner-fluid text-center'>
            <div class='row'>
                {filmes.map((filme, ind) => (
                    <div className='card'>
                        <img src={"" + filme.foto} alt="Vingadores" />
                        <div className='card-body'>
                            <h5 className='card-title'>{filme.nome} {filme.ano}</h5>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )

}
